import './App.css';
import { Router, Routes, Route } from 'react-router-dom';
import Home from "./Pages/Home"
import Dashboard from "./Dashboard"

function App() {
  return (
    <Router>
        <Routes>
            <Route path="/" element={ <Home />} />
            <Route path="/dashboard" element={ <Dashboard />} />
        </Routes>
    </Router>
  );
}

export default App;
